import React from "react";
import TextField from "../../common/TextField";
import { CategoryFormStyled } from "../../Category/components/Category.styled";
import { Button } from "react-bootstrap";

export default class CreateBookmark extends React.Component {
  constructor(props) {
    super(props);

    this.state = {
      urlName: ""
    };
  }
  changeHandler = e => {
    this.setState({ [e.target.name]: e.target.value });
  };
  submitHandler = e => {
    e.preventDefault();
  };
  render() {
    const {
      fetchUrlsBasedonCatId,
      handleChange,
      categoryId,
      fetchurls,
      categories = [],
      history
    } = this.props;
    return (
      <CategoryFormStyled>
        <form onSubmit={this.submitHandler}>
          <TextField
            onChange={this.changeHandler}
            label="URL Name"
            placeholder="Enter the URL Name"
          />
          <select
            onChange={e => {
              handleChange(e);
            }}
          ></select>

          <Button type="submit">Create</Button>
        </form>
      </CategoryFormStyled>
    );
  }
}
